import React from "react";
import styles from "./Search.module.scss";

const Search = ({ searchValue, setSearchValue }) => {
  return (
    <input
      value={searchValue}
      onChange={(Event) => setSearchValue(Event.target.value)}
      className={styles.root}
      placeholder="Поиск..."
    />
  );
};

export default Search;
